const Input = ({ type, id, value, onChange, label }) => {
  return (
    <>
      <label htmlFor={id}>{label}</label>
      <input
        type={type}
        id={id}
        value={value}
        onChange={onChange}
      />
    </>
  )
};

export default Input;
